insert  into `news`(`id`,`title`,`zaiyao`,`time`,`create_time`,`content`,`tag`,`user_id`,`user_name`) values (7,'习近平:所有扶贫地区的领导干部都要坚守岗位','','2017-03-09','2017-03-09','<div class=\"artical-player-wrap\" style=\"margin:0px auto;padding:15px 0px;font-size:12px;font-family:&quot;\">\r\n	<div class=\"a-p-hd\" style=\"padding:14px 14px 0px;background-color:#E4E4E4;text-align:center;\">\r\n		<div id=\"J_Article_Player\">\r\n		</div>\r\n		<div class=\"a-p-info\" style=\"text-align:right;\">\r\n			<span id=\"J_Video_Source\">习近平：所有扶贫地区的领导干部都要坚守岗位</span>\r\n		</div>\r\n	</div>\r\n</div>\r\n<div class=\"img_wrapper\" style=\"text-align:center;font-family:&quot;font-size:16px;\">\r\n	<img src=\"http://n.sinaimg.cn/news/transform/20170309/Ythy-fycapec3745602.jpg\" alt=\"（摄影/新华社记者兰红光、李学仁、庞兴雷）\" /><span class=\"img_descr\" style=\"line-height:20px;color:#666666;font-size:14px;\">（摄影/新华社记者兰红光、李学仁、庞兴雷）</span>\r\n</div>\r\n<div class=\"img_wrapper\" style=\"text-align:center;font-family:&quot;font-size:16px;\">\r\n	<img src=\"http://n.sinaimg.cn/news/transform/20170309/Ev9F-fychhus0138596.jpg\" alt=\"（摄影/新华社记者兰红光、李学仁、庞兴雷）\" /><span class=\"img_descr\" style=\"line-height:20px;color:#666666;font-size:14px;\">（摄影/新华社记者兰红光、李学仁、庞兴雷）</span>\r\n</div>\r\n<div class=\"img_wrapper\" style=\"text-align:center;font-family:&quot;font-size:16px;\">\r\n	<img src=\"http://n.sinaimg.cn/news/crawl/20170309/jnQW-fychhvn7897153.jpg\" alt=\"（摄影/新华社记者兰红光、李学仁、庞兴雷）\" /><span class=\"img_descr\" style=\"line-height:20px;color:#666666;font-size:14px;\">（摄影/新华社记者兰红光、李学仁、庞兴雷）</span>\r\n</div>\r\n<div class=\"img_wrapper\" style=\"text-align:center;font-family:&quot;font-size:16px;\">\r\n	<img src=\"http://n.sinaimg.cn/news/transform/20170309/oRLz-fycapec3745782.jpg\" alt=\"（摄影/新华社记者兰红光、李学仁、庞兴雷）\" /><span class=\"img_descr\" style=\"line-height:20px;color:#666666;font-size:14px;\">（摄影/新华社记者兰红光、李学仁、庞兴雷）</span>\r\n</div>\r\n<div class=\"img_wrapper\" style=\"text-align:center;font-family:&quot;font-size:16px;\">\r\n	<img src=\"http://n.sinaimg.cn/news/transform/20170309/pqpy-fychhvn7897371.jpg\" alt=\"（摄影/新华社记者兰红光、李学仁、庞兴雷）\" /><span class=\"img_descr\" style=\"line-height:20px;color:#666666;font-size:14px;\">（摄影/新华社记者兰红光、李学仁、庞兴雷）</span>\r\n</div>\r\n<p style=\"font-size:16px;font-family:&quot;\">\r\n	<strong> 习近平向全国各族各界妇女致以节日祝贺</strong>\r\n</p>\r\n<p style=\"font-size:16px;font-family:&quot;\">\r\n	今天是“三八”国际劳动妇女节，3月8日上午，习近平在四川代表团参加审议时，代表党中央、国务院，向参加全国“两会”的女代表、女委员、女工作人员，向全国各族各界妇女同胞，致以节日的祝贺和诚挚的祝福。\r\n</p>\r\n<p style=\"font-size:16px;font-family:&quot;\">\r\n	<strong> 习近平：孩子们悬崖上爬藤条，我很揪心</strong>\r\n</p>\r\n<p style=\"font-size:16px;font-family:&quot;\">\r\n	3月8日上午，习近平总书记在四川代表团参加审议时强调，要坚定不移打赢脱贫攻坚战。他说，看到凉山州“悬崖村”的村民和孩子们常年在悬崖上爬藤 条，上山下乡，安全得不到保证，看了以后心情还是很沉重，也很揪心。前不久又看到材料，说当地已经建了新的铁梯，这样，心里又感觉到松了一下。对四川的脱 贫攻坚，中央应该加大支持力度，这主要看哪里的贫困程度更深、更重。习近平强调，当然，工作还是要靠当地，主体责任还要当地党委和政府来担。\r\n</p>\r\n<p style=\"font-size:16px;font-family:&quot;\">\r\n	<strong>习近平：古路村通路了吗？</strong>\r\n</p>\r\n<p style=\"font-size:16px;font-family:&quot;\">\r\n	3月8日上午，习近平来到四川代表团参加审议。来自雅安市汉源县永利乡古路村的全国人大代表骆云莲在发言时介绍说，当地政府投资建设的高空索道已经建成，等待验收投用。总书记十分关心古路村是否通路，仔细询问相关情况。\r\n</p>\r\n<p style=\"font-size:16px;font-family:&quot;\">\r\n	<strong> 新闻背景：</strong>\r\n</p>\r\n<p style=\"font-size:16px;font-family:&quot;\">\r\n	古路村位于雅安市、乐山市、凉山彝族自治州交界处，平均海拔2000多米，一条长750多米的索道横跨该村斑鸠嘴与马坪村二道坪，800米的高空下是奔腾的大渡河。古路村的村民们要下山，得先经过开凿在绝壁上的骡马路，再过索道，然后才能坐上汽车。\r\n</p>\r\n<p style=\"font-size:16px;font-family:&quot;\">\r\n	<strong> 习近平：所有扶贫地区的领导干部都要坚守岗位</strong>\r\n</p>\r\n<p style=\"font-size:16px;font-family:&quot;\">\r\n	3月8日上午，习近平总书记在四川代表团参加审议时指出，到2020年现行标准下农村贫困人口全部脱贫、贫困县全部摘帽，是我们党立下的军令状。要 选派好驻村干部，保持基层扶贫干部相对稳定，保持工作连续性和有效性。现在所有扶贫地区的领导干部都要坚守岗位，要保证人员的稳定。（央视记者：胡玮 爱民 史伟 汉明 晓鹏 &nbsp;邢彬 德文 汉章 鹏飞 亚阳 晓东）\r\n</p>','',4,'aa'),(8,' 中国发布2016美国人权纪录 用事实驳其人权状况 ','  ','2017-03-09','2017-03-09','<p style=\"font-size:16px;font-family:;\">\r\n	国务院新闻办公室今天（9日）发布《2016年美国的人权纪录》，用大量数据和事实批驳美国的人权状况。纪录指出，2016年美国的人权状况在一些重要方面继续呈恶化趋势。\r\n</p>\r\n<p style=\"font-size:16px;font-family:;\">\r\n	当地时间3月3号，美国国务院发布《2016年国别人权报告》，对世界各国人权状况品头论足、横加指责，而对美国自身存在的严重人权问题则全然不顾。\r\n</p>\r\n<p style=\"font-size:16px;font-family:;\">\r\n	&nbsp;&nbsp;&nbsp;&nbsp;中国发布近一万字的《2016年美国的人权纪录》，从生命人身权利、政治权利、中低收入群体生活状况、种族歧视、妇女儿童老年人权利、侵犯他国人权六方面，通过事实说明，2016年美国的人权状况在一些重要方面继续呈恶化趋势。\r\n</p>\r\n<p style=\"font-size:16px;font-family:;\">\r\n	<strong> 美涉枪犯罪高发 监禁率居高不下</strong> \r\n</p>\r\n<p style=\"font-size:16px;font-family:;\">\r\n	人权纪录指出，美国涉枪犯罪持续高发，监禁率居高不下。全年共发生枪击事件58125起，共造成15039人死亡。2016年6月，一名&nbsp;&nbsp;&nbsp;&nbsp;持枪者在奥 兰多一家夜总会内开枪，造成50人死亡，53人受伤，这是美国历史上发生的最严重的枪击事件。美国监禁率居世界第二，受过监禁的人数高达7000万，占成 年人的三分之一。\r\n</p>\r\n<p style=\"font-size:16px;font-family:;\">\r\n	<strong> 美国警察滥用执法权力</strong> \r\n</p>\r\n<p style=\"font-size:16px;font-family:;\">\r\n	美国警察滥用执法权力。2016年共有963人被警察枪杀。警察滥用职权枪杀平民却极少被追究刑事责任。\r\n</p>\r\n<p style=\"font-size:16px;font-family:;\">\r\n	<strong> 美国选举政治权利无法保障</strong> \r\n</p>\r\n<p style=\"font-size:16px;font-family:;\">\r\n	&nbsp;&nbsp;&nbsp;&nbsp;2016年，金钱政治和权钱交易主导美国选举，竞选过程谎言充斥，闹剧不断，政治权利无法保障，民众抵制和抗议活动此起彼伏。\r\n</p>\r\n<p style=\"font-size:16px;font-family:;\">\r\n	<strong> 美国中低收入群体生活状况堪忧</strong> \r\n</p>\r\n<p style=\"font-size:16px;font-family:;\">\r\n	美国贫富差距不断扩大，中低收入群体生活状况堪忧。2016年，美国成年人全职工作比例创1983年以来最低水平。过去30年将近70%的收入流入到最富有的10%的人的腰包。4500万贫困人口生活困难，七分之一的美国人生活在贫困线以下。\r\n</p>\r\n<p style=\"font-size:16px;font-family:;\">\r\n	<strong> 美国种族主义持续存在 关系恶化</strong> \r\n</p>\r\n<div id=\"ad_44086\" class=\"otherContent_01\" style=\"font-family:\" font-size:16px;margin:10px=\"\" 20px=\"\" 10px=\"\" 0px;padding:4px;\"=\"\">\r\n<iframe width=\"300px\" height=\"250px\" frameborder=\"0\" src=\"http://static-alias-1.360buyimg.com/jzt/tpl/sspPic.html?ad_ids=2424:5&adflag=0&clkmn=&expose=\">\r\n</iframe>\r\n	</div>\r\n	<p style=\"font-size:16px;font-family:;\">\r\n		美国种族主义持续存在，种族关系日趋恶化。联合国人权理事会非洲裔问题专家工作组调查报告称，美国国内种族问题严重，没有解决好殖民历史、奴隶制、种族隔离、种族不平等和种族恐怖主义等问题。美国正面临一场“人权危机”。\r\n	</p>\r\n	<p style=\"font-size:16px;font-family:;\">\r\n		<strong> 美国弱势群体权利受到严重侵犯</strong> \r\n	</p>\r\n	<p style=\"font-size:16px;font-family:;\">\r\n		美国妇女儿童老年人权利保障状况未见改善，弱势群体权利受到严重侵犯。女性收入大幅低于男性。约四分之一的女性曾在工作中受到过性骚扰。每年约有500万老年人遭到虐待。\r\n	</p>\r\n	<p style=\"font-size:16px;font-family:;\">\r\n		<strong> 美国依然粗暴侵犯他国人权</strong> \r\n	</p>\r\n	<p style=\"font-size:16px;font-family:;\">\r\n		美国依然粗暴侵犯他国人权，空袭造成大量平民伤亡，海外监听项目侵犯他国公民隐私权。非法关押和虐待他国囚犯问题迟迟未得到解决。\r\n	</p>\r\n	<p style=\"font-size:16px;font-family:;\">\r\n		<strong> 美仍未批准核心国际人权公约</strong> \r\n	</p>\r\n	<p style=\"font-size:16px;font-family:;\">\r\n		美国至今仍未批准《经济、社会和文化权利国际公约》《消除对妇女一切形式歧视公约》等核心国际人权公约，拒不接受联合国有关人权决议草案。\r\n	</p>\r\n	<p style=\"font-size:16px;font-family:;\">\r\n		和人权纪录同时发布的还有一万六千字的《2016年美国侵犯人权事记》，按时间顺序记录了去年一年发生在美国的侵犯人权事件。\r\n	</p>','',4,'aa'),(9,'seeGV','涩女给对方','2017-02-28','2017-03-11','色的贝多芬你','电饭煲的   当仁不让的 ',4,'aa');

/*Table structure for table `permissions` */

DROP TABLE IF EXISTS `permissions`;

CREATE TABLE `permissions` (
  `id` int(5) NOT NULL AUTO_INCREMENT,
  `p_code` varchar(5) COLLATE utf8_bin DEFAULT NULL,
  `p_controller` varchar(30) COLLATE utf8_bin DEFAULT NULL,
  `p_method` varchar(30) COLLATE utf8_bin DEFAULT NULL,
  `p_desc` varchar(30) COLLATE utf8_bin DEFAULT NULL,
  `p_pid` varchar(40) COLLATE utf8_bin DEFAULT NULL,
  `p_route` varchar(40) COLLATE utf8_bin DEFAULT NULL,
  `g_id` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

